import './App.css';
import Map from "mapmyindia-react";
import React from 'react';
import {lat1,long1} from './location.js';
var lat= 18.5314,long=73.845;

  function App() {
    function get(){
      lat=lat1;
      long=long1;
      return 1;
    }
    if(get()){
      return (
        <Map
          markers={[
              { 
                  position: [ parseFloat(lat) , parseFloat(long)],
                  draggable: true, 
                  title:parseFloat(lat),
                  onClick: e => {
                      console.log("clicked ");
                  },
                  onDragend: e => {
                      console.log("dragged");
                  }
              }
          ]}
          />
     );
        }


  }

export default App;
